rgb_thread = util.create_thread(function(thr)
    local r = 255
    local g = 0
    local b = 0
    rgb = {255, 0, 0}
    while true do  
        --Smooth RGB--
        if r > 0 and g < 255 and b == 0 then
            r = r - 1
            g = g + 1
        elseif r == 0 and g > 0 and b < 255 then
            g = g - 1
            b = b + 1
        elseif r < 255 and b > 0 then
            r = r + 1
            b = b - 1
        end
        randR = r
        randG = g
        randB = b
        util.yield()
    end
end)

