util.create_thread(function()
	while true do
		if PtfxPrompt then 
            if PAD.IS_CONTROL_PRESSED(0, 47) then
                ptfxStart(CurrentAnimation)
                util.yield(PtfxWait)
                if PtfxCanHold then
                    while PAD.IS_CONTROL_PRESSED(0, 47) and IsInAnimation do
                        util.yield(10)
                    end
                end
                ptfxStop()
            end
        end
		util.yield()
	end
end)

